import List from "./components/List";
import PropTypes from 'prop-types';

function App() {
  return (
    <div className="App">
      <header>
        <h1>TrybeMail</h1>
        <List/>
      </header>
    </div>
  );
}

List.propTypes = {
  messages: PropTypes.arrayOf(
    PropTypes.shape({
      id: PropTypes.number,
      title: PropTypes.string,
      status: PropTypes.number,
    }),
  ).isRequired,
};

export default App;
